const Disclaimer = (props) => {
  return (
    <div className="p-10 bg-white text-black fixed z-10 top-0 left-0 disclaimer rounded-3xl max-w-md">
      <div className="flex flex-row justify-between items-end mb-6">
        <h2 className="text-3xl leading-none">Disclaimer</h2>
        <div
          className="dot-md rotate-45 hover:bg-black hover:text-white cursor-pointer"
          onClick={props.onClick}
        >
          <span className="relative top-.5 left-2.5 text-2xl">+</span>
        </div>
      </div>
      <h3 className="mb-8">
        This website is not associated with Nike or their subsidiary companies
        in any way. Neither Nike nor their subsidiary companies have endorsed
        this website. This website has been created as a prototype in attempt to
        combine Web3 and the Nike Run Club ecosystem.
      </h3>
      <button className="bg-gray-200 hover:bg-black hover:text-white text-black py-2 px-10 rounded-full transition-opacity duration-100">
      </button>
    </div>
  );
};
export default Disclaimer;
